import logo from '../images/logo.png';
import facebookicon from '../images/facebookicon.png';
import PopupModal from './PopupModal.js';

import { Link, useNavigate } from "react-router-dom";

const viartriallink = "https://www.twitter.com";
const prospanlink = "https://www.twitter.com";

function Footer() {

    const navigate = useNavigate();
    const naviSupplements = () => {
        navigate('/products');
    };

    return(
        <>
            <div className="footer">
                <div className="container-fluid section">
                    <div className="row">
                        <div className="col">
                            <Link href="#home" target="_blank" rel="noreferrer noopener"><img className="logo" src={logo} alt="logo"/></Link>
                        </div>
                    </div>

                    <div className="row">
                        <div className="col-12 col-md-4">
                            <p>Delivering Health, One Prescription At A Time</p>
                            <p><Link href={viartriallink} target="_blank" rel="noreferrer noopener"><img className="mini-icon"  src={facebookicon} alt="Facebook"/>Viartril-S Facebook</Link></p>
                            <p><Link href={prospanlink} target="_blank" rel="noreferrer noopener"><img className="mini-icon"  src={facebookicon} alt="Facebook"/>Prospan Facebook</Link></p>
                        </div>

                        <div className="col-12 col-md-4">
                            <p className="footer-title">Our products</p>
                            <p><Link onClick={naviSupplements}>Supplements</Link></p>
                            <p><a className="link" href={viartriallink} target="_blank" rel="noreferrer noopener">Injury </a></p>
                            <p><a className="link" href={viartriallink} target="_blank" rel="noreferrer noopener">Illness </a></p>
                            <p><a className="link" href={viartriallink} target="_blank" rel="noreferrer noopener">Dermatological </a></p>
                            <p><a className="link" href={viartriallink} target="_blank" rel="noreferrer noopener">Disinfectant </a></p>
                            <p><a className="link" href={viartriallink} target="_blank" rel="noreferrer noopener">Medical Tools </a></p>
                        </div>

                        <div className="col-12 col-md-4">
                            <p className="footer-title">Contact us</p>
                            <p>+65 6286 0291</p>
                            <p>705 Sims Drive #02-07, Shun Li Industrial Complex, Singapore 387384</p>
                        </div>

                    </div>

                    <div className="row">
                        <div className="col copyright">
                            <PopupModal/>
                            <p>• Copyright © 2023 Pharmline Marketing Pte Ltd</p>
                        </div>
                    </div>

                </div>
            </div>

        </>
    );
}

export default Footer;
